private void updateCacheExpiryTime() {
  if (cacheTimeout < 0) {
    cacheExpiryTimeStamp = -1; // no automatic cache expiry.
  }else {
    cacheExpiryTimeStamp = System.currentTimeMillis() + cacheTimeout;
  }
}
